* (% id='project1' class='project' %)[[Platform>>platform:Main.WebHome]] (%class='details hidden-xs'%)[[XWiki Platform>>platform:Main.WebHome]] is the generic wiki platform offering runtime services for applications built on top of it.(%%)
* (% id='project2' class='project' %)[[Enterprise>>enterprise:Main.WebHome]] (%class='details hidden-xs'%)[[XWiki Enterprise>>enterprise:Main.WebHome]] is a [[fully-featured>>enterprise:Main.Features]] wiki for the Enterprise. It's also a [[second generation wiki>>xwiki:Main.SecondGenerationWiki]] offering the ability to install and develop small applications inside wiki pages.(%%)
* (% id='project3' class='project' %)[[Manager>>manager:Main.WebHome]] (%class='details hidden-xs'%)[[XWiki Enterprise Manager>>manager:Main.WebHome]] is an application to manage a farm of wikis, allowing large-scale organization and massive scalability.(%%)
